D Y N A M I C  P H O T O G R A P H Y📸
.
I am constantly pushing myself creatively so I don’t burn out. Over the last few years I’ve photographed over 1,000 steaks. For this shot I wanted it to be dynamic, tell a story and make you stop to look at the details. This is a 2 strobe light setup. The main key light is hitting me and the steak. The other light has an orange gel hitting the backdrop creating a sexy mood. I also added a fog machine to create haze and depth. I hope this inspires you guys to try something new with your photography 🤛📸
