SMOKED WHOLE FISH 🐟 
.
I’ve always loved shooting proteins, especially in its raw element. A highly marbled steak, a beautifully colored fish, they have textures and tones that photograph so well. I smoked this rock cod at 450 degrees on the @traegergrills Timberline XL. I seasoned with olive oil, salt, pepper, stuffed with lemons, parsley, garlic, and tarragon! 
